function createfigure(X1, YMatrix1)
%CREATEFIGURE(X1, YMatrix1)
%  X1:  vector of x data
%  YMATRIX1:  matrix of y data

%  Auto-generated by MATLAB on 13-Oct-2019 12:05:02

% Create figure
figure1 = figure;

% Create axes
axes1 = axes('Parent',figure1,...
    'Position',[0.13 0.112380952380952 0.775 0.815]);
hold(axes1,'on');

% Create multiple lines using matrix input to plot
plot1 = plot(X1,YMatrix1,'LineWidth',2.5,'Parent',axes1);
set(plot1(1),'DisplayName','GraphRNN','Marker','diamond');
set(plot1(2),'Marker','o');
set(plot1(3),'DisplayName','DSBM','Marker','square');

% Create ylabel
ylabel('Time(s)/per enpoch','FontWeight','bold');

% Create xlabel
xlabel('Nodes size');

% Create title
title('Runtime','FontWeight','bold');

box(axes1,'on');
% Set the remaining axes properties
set(axes1,'FontWeight','bold','TitleFontWeight','normal');
